import React from 'react'

const Card = (props) => {
    let options =props.option;

    return (
        <div>
            <div className="card m-5" style={{ "width": "18rem", "maxHeight": "300px" }}>
                <img src="https://cdn.pixabay.com/photo/2018/04/13/17/12/vegetable-skewer-3317055_640.jpg" className="card-img-top" alt="..." />
                <div className="card-body">
                    <h5 className='card-title'>{props.foodname}</h5>
                    {/* <p className="card-text">{props.des}</p> */}
                    <div className='container w-100'>
                        <select className='bg-success m-2 h-70 rounded'>
                            {Array.from(Array(4), (e, i) => {
                                return <option key={i + 1} value={i + 1}>{i + 1}</option>
                            })}
                        </select>
                        <select className='bg-success m-2 h-70  rounded'>
                            <option key='half' value='half'>Half</option>
                            <option key='full' value='full'>Full</option>
                        </select>
                        <div className='d-inline h-100 fs-5'> Price</div>
                    </div>
                </div>
            </div>
        </div>
    )
}
export default Card;
